import React,{useState}from "react"; 
import { AddingElement } from "./AddingElement";
import { ShowDelete } from "./ShowDelete";


//Style Of Component
import './listGenerator.scss';

const ListGenerator = () => {


	const [listComplete,setListComplete ]=useState( [{
		id:0,
		name:"name",
		description:"description",
		status:"staus", 
	}] )



	return(
		<div className="todolist-listgenerator">
			<div className="listgenerator-table-container">  
				<div  className="listgenerator-title" >
						<h1>TO DO LIST</h1>
				</div>
				<AddingElement listComplete={listComplete} setListComplete={setListComplete} /> 
				<ShowDelete  listComplete={listComplete} setListComplete={setListComplete}  />  
			</div> 
		</div>
	)
}

ListGenerator.propTypes = { 
}; 

ListGenerator.defaultProps = { 
};




export default React.memo(ListGenerator);
